    false,nt"url": null,nt"notes": "Map Information:nnThis nowCOAST map service
    provides maps depicting the administrative boundaries of NOAA/NWS and some of its
    federal partners including FAA, USCG, and USACE. It also includes the geographic
    breakpoints (geographic locations) along the U.S. coast used by NOAA/NWS National
    Hurricane Center (NHC) when issuing tropical cyclone watches and warnings along
    the immediate coastline. The administrative boundaries are updated when changes
